    infAnim(el, pathFrom, pathMid, pathTo, dir, svgName, dataName, isFade, animateTime=1000) {
      // MEMO: thisがvueを指していないので対策
      var _this = this
      var mid, end, fadeinORfadeout
      if (dir === 'up') {
        mid = pathMid
        end = pathTo
        fadeinORfadeout = 'fadein'
        dir = 'down'
      } else {
        mid = pathMid
        end = pathFrom
        fadeinORfadeout = 'fadeout'
        dir = 'up'
      }
      if (mid !== null) {
        el.animate({d: mid}, animateTime+500, function() {
