    setLeavesVisible(fadeinORfadeout, svgName, dataName, isFade) {
      if (isFade) {
        if (svgName === 'svg1') {
          if (fadeinORfadeout === 'fadein') {
            this.isFadeinLeaves = true
            this.isFadeoutLeaves = false
          } else if (fadeinORfadeout === 'fadeout') {
            this.isFadeinLeaves = false
            this.isFadeoutLeaves = true
          }
        } else if (svgName === 'svg2') {
          if (fadeinORfadeout === 'fadein') {
            if (dataName === 'l3') {
              this.isFadeinLeaves3 = true
              this.isFadeoutLeaves3 = false
            } else if (dataName === 'l4') {
